import class_dialogs from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className={class_dialogs.dialogs}>
      <div className={class_dialogs.dialog_item}>
        <div className={class_dialogs.dialog + " " + class_dialogs.active}>
          Ekaterina
        </div>
        <div className={class_dialogs.dialog}>Yulia</div>
        <div className={class_dialogs.dialog}>Nadiay</div>
        <div className={class_dialogs.dialog}>Viacheslav</div>
        <div className={class_dialogs.dialog}>Oksana</div>
        <div className={class_dialogs.dialog}>Evgeniy</div>
        <div className={class_dialogs.dialog}>Aleksandr</div>
        <div className={class_dialogs.dialog}>Ivan</div>
      </div>
      <div className={class_dialogs.messages}>
        <div className={class_dialogs.message}>Hi</div>
        <div className={class_dialogs.message}>What is your name?</div>
        <div className={class_dialogs.message}>My name is Andrey</div>
      </div>
      Dialogs
    </div>
  );
};

export default Dialogs;
